SOUTH FLORIDA FORECAST- Look for indirect impacts associated with #Idalia. Nothing significant, but some of the rain bands are set to soak the Florida Keys first & then mainland South #Florida between 11am-6pm. Heavy rainfall, gusty winds & brief tornado can't be ruled out. 

TROPICAL STORM WATCH in effect for Lower Florida Keys. T.S. Warning for the Dry Tortugas. This means T. S. force winds (39+mph) possible from early Tuesday morning until early Wednesday morning. Winds increase after midnight 20-30mph with higher gusts. Also, minor saltwater flooding possible.

